    function showData (list, name) {
        var html = '<div>';
            html += '<h2>' + name + '</h2>';
        if (list.length) {
            html += '<ul>';
            for (var l,i = 0; i < list.length; i++) {
                l = i <= MAX_ENTRIES ? list[i] :
                    '... <span style="font-style: italic;">(' +
                    (list.length-MAX_ENTRIES) + ' more)</span>';
                html += '<li>' + l + '</li>';
                if (i > MAX_ENTRIES) break;                    
            }
            html += '</ul>';
        } else {
            html += '<ul><li>(none)</li></ul>';
        }
        html += '</div>';
        return html;
    }
    
    function showTag () {
        var $this = $(this),
            tagName, tag, html, i,
            error = '<span style="color: red;">error</span>';
        tagName = $this.data('tag');
        if (tagName === undefined) return error;
        tag = data[tagName];
        if (tag === undefined) return error;
        html = '<div class="xml-tooltip">';
        //html += '<h2>' + tagName + '</h2>';
        html += showData(tag.a.sort(), 'Attributes');
        html += showData(tag.c.sort(), 'Childnodes');
        html += '</div>';
        return html;
    }
    
